import React from 'react';
import Button from 'react-bootstrap/Button';
import './../style/UStyle.css'


export default class UButton extends React.Component {
  constructor(props) {
    super(props);

    this.content = props.content
    this.variant = props.variant
    this.size = props.size
    this.disabled = props.disabled
    this.centered = props.centered
    this.blink = false
  }

  render() {
    var classes = classNames({
      'centered': true,
      'blink': this.blink
    });
    return (
      <Button className={this.centered} disabled={this.disabled} size={this.size} variant={this.variant}>{this.content}</Button>
    )
  }
}
